// be careful about permutation !
void _premu(int* n, int s, int e, int* num)
{
    if (s == e)
    {
        out(n, e + 1);
        for (int i = 0; i <= e; i ++)
            if (n[i] == i)
                return;
        (*num) ++;
        return;
    }

    int t = n[s];
    // start from s
    for (int i = s; i <= e; i ++)
    {
        n[s] = n[i];
        n[i] = t;
        _premu(n, s + 1, e, num);
        n[i] = n[s];
        n[s] = t;
    }
}

